import React from 'react'
import GoogleMapReact from 'google-map-react';

function Map() {
    const coordinates = { lat: 0 ,lng: 0};

    return (
    
    <div class="container">
        <GoogleMapReact
            bootstrapURLKeys={{ key: "" }}
            defaultCenter = {coordinates}
            center = {coordinates}
            defaultZoom = {14}
            margin = {[50, 50, 50, 50]} 
            option = {''}
            onChange = {''}
            onChildClick = {''}
        >
        </GoogleMapReact>
    </div>
  );
}

export default Map;
